import React from 'react'
import { Link } from 'react-router-dom'

const Rooms = () => {
  return (
    <div>
        <Link to="1">Room 1</Link>
        <Link to="2">Room 2</Link>
        <Link to="3">Room 3</Link>
    </div>
  )
}

export default Rooms
